import "./App.css";
import Main from "./components/main";
import Games from "./components/games";

function App() {
  return (
    <div className="App">
      <header></header>
      <main>
        <Main />
      </main>
      <footer>
        <Games />
      </footer>
    </div>
  );
}

export default App;
